pyserde is a simple yet powerful serialization library on top of dataclasses . Simply adding pyserde's @serde decorator makes your class (de)serializable from/to many data formats. @serde
@dataclass
class Foo: i: int s: str f: float b: bool You can serialize Foo object into JSON. >>> to_json(Foo(i=10, s='foo', f=100.0, b=True))
'{"i":10,"s":"foo","f":100.0,"b":true}' You can deserialize JSON into Foo object. >>> from_json(Foo, '{"i": 10, "s": "foo", "f": 100.0, "b": true}')
Foo(i=10, s='foo', f=100.0, b=True)

