@dataclass
class Foo: int_field: int str_field: str = field(rename='str-field') f = Foo(int_field=10, str_field='foo')
print(to_json(f)) The above code prints {"intField": 10, "str-field": "foo"} See examples/rename_all.py for the complete example.

