This is the default Union representation for pyserde<0.7. Given these dataclasses, @serde
@dataclass
class Bar: b: int @serde
@dataclass
class Baz: b: int @serde(tagging=Untagged)
@dataclass
class Foo: a: Union[Bar, Baz] Note that Bar and Baz have the same field name and type. If you serialize Foo(Baz(10)) into dict, you get {"a": {"b": 10}}. But if you deserialize {"a": {"b": 10}}, you get Foo(Bar(10)) instead of Foo(Baz(10)). This means pyserde can't correctly (de)serialize dataclasses of Union with Untagged . This is why pyserde offers other kinds of union representation options.

