Strict type checking is to check every value against the declared type during (de)serialization. We plan to make Strict a default type checker in the future release. @serde(type_check=Strict)
@dataclass
class Foo s: str foo = Foo(10)
# pyserde checks the value 10 is instance of `str`.
# SerdeError will be raised in this case because of the type mismatch.
print(to_json(foo)) NOTE: Since pyserde is a serialization framework, it provides type checks or coercing only during (de)serialization. For example, pyserde doesn't complain even if incompatible value is assigned in the object below. @serde(type_check=Strict)
@dataclass
class Foo s: str f = Foo(100) # pyserde doesn't raise an error If you want to detect runtime type errors, I recommend to use beartype . @beartype
@serde(type_check=Strict)
@dataclass
class Foo s: str f = Foo(100) # beartype raises an error
